import React, { useState } from 'react';

function BuySellTransfer() {

    const [hidden, setHidden] = useState(false);

    var jsonData = {
      "users": [
          {
              "name": "alan", 
              "age": 23,
              "username": "aturing"
          },
          {
              "name": "john", 
              "age": 29,
              "username": "__john__"
          }
      ]
    }

    function handleClick() {

      // Send data to the backend via POST
      fetch('http://------------:8080/', {  // Enter your IP address here
        method: 'POST', 
        mode: 'cors', 
        body: JSON.stringify(jsonData) // body data type must match "Content-Type" header

      })

    }

    return (
    <div>
        <div className="transactionSpace">
        <div hidden={!hidden}>hidden component</div>
        </div>
        <table width="100%">
        <tbody>
        <tr>
        <td align="left" cellpadding="0" cellspacing="0">
        <button className="btn btn-primary" onClick={() => setHidden(!hidden)}>
            Buy
        </button>
        </td>
        <td align="left">
        <button className="btn btn-primary" onClick={() => setHidden(!hidden)}>
            Sell
        </button>
        </td>
        <td align="left">
        <button className="btn btn-primary" onClick={() => setHidden(!hidden)}>
            Transfer
        </button>
        </td>
        <td align="right">
        <button className="btn btn-primary" onClick={() => setHidden(!hidden)}>
            Stake
        </button>
        </td>
        </tr>
        </tbody>
        </table>
    </div>
    );

  }

  export default BuySellTransfer;
